Insert into ENZYME_PORTAL_SUMMARY (ENZYME_ID,UNIPROT_ACCESSION,DBENTRY_ID,COMMENT_TYPE,COMMENT_TEXT) values (10554,'O43462',36789983,'DISEASE','Keratosis follicularis spinulosa decalvans X-linked (KFSDX) [MIM:308800]: A rare disorder affecting the skin and the eye. Affected men show thickening of the skin of the neck, ears, and extremities, especially the palms and soles, loss of eyebrows, eyelashes and beard, thickening of the eyelids with blepharitis and ectropion, and corneal degeneration.');
Insert into ENZYME_PORTAL_SUMMARY (ENZYME_ID,UNIPROT_ACCESSION,DBENTRY_ID,COMMENT_TYPE,COMMENT_TEXT) values (19705,'O43462',36789983,'DISEASE','IFAP syndrome with or without BRESHECK syndrome (IFAPS) [MIM:308205]: A syndrome characterized by a peculiar triad of follicular ichthyosis, total or subtotal atrichia, and photophobia of varying degree. Histopathologically, the epidermal granular layer is generally well-preserved or thickened at the infundibulum. Hair follicles are poorly developed and tend to be surrounded by an inflammatory infiltrate. A subgroup of patients is described with lamellar rather than follicular ichthyosis. Non-consistent features may include growth and psychomotor retardation, aganglionic megacolon, seizures and nail dystrophy.');
Insert into ENZYME_PORTAL_SUMMARY (ENZYME_ID,UNIPROT_ACCESSION,DBENTRY_ID,COMMENT_TYPE,COMMENT_TEXT) values (24585,'O43462',36789983,'DISEASE','Olmsted syndrome, X-linked (OLMSX) [MIM:300918]: A rare congenital disorder characterized by bilateral mutilating palmoplantar keratoderma and periorificial keratotic plaques with severe itching at all lesions. Diffuse alopecia, constriction of digits, and onychodystrophy have also been reported. Infections and squamous cell carcinomas can arise on the keratotic areas. The digital constriction may progress to autoamputation of fingers and toes.');
Insert into ENZYME_PORTAL_SUMMARY (ENZYME_ID,UNIPROT_ACCESSION,DBENTRY_ID,COMMENT_TYPE,COMMENT_TEXT) values (19852,'O75881',35174678,'DISEASE','Congenital bile acid synthesis defect 3 (CBAS3) [MIM:613812]: A disorder resulting in severe cholestasis, cirrhosis and liver synthetic failure. Hepatic microsomal oxysterol 7-alpha-hydroxylase activity is undetectable.');
Insert into ENZYME_PORTAL_SUMMARY (ENZYME_ID,UNIPROT_ACCESSION,DBENTRY_ID,COMMENT_TYPE,COMMENT_TEXT) values (19853,'O75881',35174678,'DISEASE','Spastic paraplegia 5A, autosomal recessive (SPG5A) [MIM:270800]: A form of spastic paraplegia, a neurodegenerative disorder characterized by a slow, gradual, progressive weakness and spasticity of the lower limbs. Rate of progression and the severity of symptoms are quite variable. Initial symptoms may include difficulty with balance, weakness and stiffness in the legs, muscle spasms, and dragging the toes when walking. In some forms of the disorder, bladder symptoms (such as incontinence) may appear, or the weakness and stiffness may spread to other parts of the body.');
Insert into ENZYME_PORTAL_SUMMARY (ENZYME_ID,UNIPROT_ACCESSION,DBENTRY_ID,COMMENT_TYPE,COMMENT_TEXT) values (17594,'Q07973',35170567,'DISEASE','Hypercalcemia infantile (HCAI) [MIM:143880]: A disorder characterized by abnormally high level of calcium in the blood, failure to thrive, vomiting, dehydration, and nephrocalcinosis.');
